title:
Hofstede Rooswijk in Velsen-Noord, ca. 1920. Op de voorgrond water. In de tweede helft van de 19de eeuw werd het 18de-eeuwse huis uitgebreid met de twee torens. Het landgoed werd
          in 1931 door de gemeente Velsen gekocht. In november 1944 is het Huis door b 1 topogr. prent: ets met plaattoon. in de plaat r.o.: VR ; r.o. in potlood: B.v. Riemsdijk afb.: 127 x 178 mm;
          plaatrand: 140 x 192 mm; blad: 255 x 325 mm
